<h3>1.2 举个例子</h3>
<figure><figcaption>变量例子</figcaption></figure>
<p>——所以，<strong>变量就是在计算机的内存中开辟空间，来储存数据</strong>。 （<code>ctrl + B</code> 加粗）</p>
